import React from 'react'
import ShowDays from './ShowDays'

const meet = new Date("02/06/2019")
console.log(meet)
const time1 =  new Date("02/06/2020");
console.log(time1)
var total_days= (time1.getTime() - meet.getTime());
console.log(Math.floor(time1.getFullYear()-meet.getFullYear()))
console.log(Math.floor(total_days/(1000 * 3600 * 24))+1);
var second = Math.floor(total_days/1000)
console.log(second)
var minute = Math.floor(second/60)
console.log(minute)
class Love extends React.Component{
    constructor(props) {
    super(props);
    this.state = {
      time: new Date().toLocaleString(),
      total_days: 0,
      years: 0,
      months: 0,
      days:0,
      hours: 0,
      minutes: 0,
      second: 0,
    };
  }
  
  componentDidMount() {
    this.intervalID = setInterval(
      () => this.tick(),
      1000
    );
  }

  componentWillUnmount() {
    clearInterval(this.intervalID);
  }

  tick() {
    this.setState({
      time: new Date().toLocaleString()
    });
  }
    render(){
        return(
            <>
                <ShowDays></ShowDays>
            </>
        )
    }
}

export default Love;
